   "source": [
    "# Задание 3\n",
    "# Загрузка данных\n",
    "data <- read.csv2(\"/kaggle/input/basic-regression-learning-dataset/Students_Stats.csv\")\n",
    "\n",
    "# Преобразование переменных\n",
    "data$Tech <- as.numeric(data$Tech)\n",
    "data$Optimism <- as.numeric(data$Optimism)\n",
    "data$Average_Score <- as.numeric(data$Average_Score)\n",
    "data$Sex <- as.factor(data$Sex)\n",
    "data$Is_olympiads <- as.factor(data$Is_olympiads)\n",
    "data$Is_Rebuke <- as.numeric(data$Is_Rebuke)\n",
    "\n",
    "# Удаление пропусков\n",
    "data <- na.omit(data)\n",
    "\n",
    "# Построение модели\n",
    "model <- lm(Tech ~ Sex + Is_Rebuke + Optimism + Average_Score + \n",
    "            Is_olympiads:Optimism + Is_olympiads:Sex, data = data)\n",
    "\n",
    "summary(model)\n",
    "\n",
    "# Диагностика\n",
    "par(mfrow = c(2, 2))\n",
    "plot(model)\n",
    "\n",
    "# Тест на нормальность\n",
    "shapiro.test(residuals(model))\n",
    "\n",
    "# Дополнительные метрики\n",
    "cat(\"\\nОстаточная стандартная ошибка:\", sigma(model), \"\\n\")\n",
    "cat(\"Adjusted R-squared:\", summary(model)$adj.r.squared, \"\\n\")\n",
    "cat(\"AIC:\", AIC(model), \"\\n\")\n",
    "cat(\"BIC:\", BIC(model), \"\\n\")"
   ]
