   "source": [
    "Построена линейная регрессионная модель, объясняющая зависимость показателя Tech от пола, оптимизма, среднего балла и дисциплинарных замечаний с учётом участия в олимпиадах. Модель статистически значима F-statistic:  5002 p-value: < 2.2e-16. Объясняющая способность модели тоже  высокая Multiple R-squared:  0.968. Все коэффициенты высоко значимы. Мужской пол снижает Tech на 27.2 балла, каждая единица Optimism снижает Tech на 0.36, Average_Score увеличивает Tech на 0.18 балла. Эффекты взаимодействия с олимпиадами также статистически значимы (p < 2e-16). \n",
