   "source": [
    "# Задание 4\n",
    "library(tidyverse)\n",
    "\n",
    "data <- read.csv2(\"/kaggle/input/basic-regression-learning-dataset/Students_Stats.csv\") %>%\n",
    "  mutate(\n",
    "    Average_Score     = as.numeric(Average_Score),\n",
    "    Life_Satisfaction = as.numeric(Life_Satisfaction),\n",
    "    Score_Confidence  = as.numeric(Score_Confidence),\n",
    "    Phys              = as.numeric(Phys),\n",
    "    Is_olympiads      = factor(Is_olympiads)\n",
    "  ) %>%\n",
    "  drop_na(Phys, Life_Satisfaction, Average_Score, Score_Confidence, Is_olympiads)\n",
    "\n",
    "m1 <- lm(Phys ~ Life_Satisfaction + Average_Score, data = data)\n",
    "m2 <- lm(Phys ~ Life_Satisfaction + Average_Score + Score_Confidence, data = data)\n",
    "m3 <- lm(Phys ~ Life_Satisfaction + Average_Score + Score_Confidence + Is_olympiads, data = data)\n",
    "\n",
    "anova(m1, m2)\n",
    "anova(m2, m3)\n",
    "\n",
    "data.frame(\n",
    "  Model = c(\"m1\",\"m2\",\"m3\"),\n",
    "  Adj_R2 = c(summary(m1)$adj.r.squared, summary(m2)$adj.r.squared, summary(m3)$adj.r.squared),\n",
    "  AIC = c(AIC(m1), AIC(m2), AIC(m3)),\n",
    "  BIC = c(BIC(m1), BIC(m2), BIC(m3))\n",
    ")\n",
    "\n",
    "par(mfrow = c(2, 2)); plot(m3); par(mfrow = c(1, 1))\n",
    "shapiro.test(residuals(m3))\n"
   ]
  },
