   "source": [
    "Все три модели имеют плохую точность, и они не достоверны. Скорректированный r2 везде отрицательный, при добавлении переменных статистически значимой разницы нет (p value >0.05). Сравнение моделей с помощью F-теста показало, что добавление переменной Score_Confidence не приводит к статистически значимому улучшению модели (p value = 0.156), включение  переменной Is_olympiads также не улучшает модель (p-value = 0.493). Можно сказать, что Life_Satisfaction, Average_Score, Score_Confidence и Is_olympiads не оказывают линейного влияния на phys. Влияния либо вообще нет, либо его нельзя объяснить линейной моделью."
