   "source": [
    "# Задание 5\n",
    "library(tidyverse)\n",
    "\n",
    "hr <- read.csv(\"/kaggle/input/hr-analytics-dataset/HR_Analytics.csv\")\n",
    "\n",
    "#str(hr)\n",
    "\n",
    "hr <- hr %>% \n",
    "  mutate(\n",
    "    Gender = factor(Gender)\n",
    "  )\n",
    "\n",
    "model <- lm(\n",
    "  MonthlyIncome ~ Age * Gender + TotalWorkingYears + TrainingTimesLastYear,\n",
    "  data = hr\n",
    ")\n",
    "\n",
    "summary(model)\n",
    "\n",
    "par(mfrow = c(2, 2))\n",
    "plot(model)\n",
    "par(mfrow = c(1, 1))\n"
   ]
  },
