    "Так-с. В задании написано про переменную количество \"проектов за последний год\", но тут либо у меня глаз окончательно замыливается, либо тут ее нет. Взята была вместо нее переменная TrainingTimesLastYear, самое близкое по смыслу, как по мне.\n",
    "Самым значимым фактором является опыт работы, +1 год опыта работы = 489 у.е дохода (p-value <0.05). Возраст имеет отрицательное влияние (коэффициент = −38.89, p-value = 0.013). Пол сотрудника и взаимодействие возраста с полом статистически незначимы (p-value = 0.294, p-value = 0.252). Количество обучений за последний год тоже не оказывает влияния (p-value = 0.736). Качество модели нормальное (r2=0.598), модель в целом статистически значима (p-value < 2.2e−16)"
   ]
