   "source": [
    "# Задание 6\n",
    "#Так-с, ну я вчера делал почти тоже самое с этим датасетом, но там была линейная регрессия и независимая переменная была одна. Целевой остается g3, независимыми я взял studytime и failures.\n",
    "library(dplyr)\n",
    "\n",
    "student <- read.csv(\"/kaggle/input/student-performance-data/student_data.csv\")\n",
    "\n",
    "df <- student %>%\n",
    "  transmute(\n",
    "    G3 = as.numeric(G3),\n",
    "    studytime = factor(studytime),   # факторная\n",
    "    failures = as.numeric(failures)  # количественная\n",
    "  ) %>%\n",
    "  drop_na()\n",
    "\n",
    "str(df)\n",
    "summary(df)\n",
    "m_linear <- lm(G3 ~ studytime + failures, data = df)\n",
    "summary(m_linear)\n",
    "m_quad <- lm(G3 ~ studytime + failures + I(failures^2), data = df)\n",
    "summary(m_quad)\n",
    "anova(m_linear, m_quad)\n",
    "df$pred_linear <- predict(m_linear, df)\n",
    "df$pred_quad   <- predict(m_quad, df)\n",
    "\n",
    "RMSE_linear <- sqrt(mean((df$G3 - df$pred_linear)^2))\n",
    "RMSE_quad   <- sqrt(mean((df$G3 - df$pred_quad)^2))\n",
    "\n",
    "MAE_linear <- mean(abs(df$G3 - df$pred_linear))\n",
    "MAE_quad   <- mean(abs(df$G3 - df$pred_quad))\n",
    "\n",
    "RMSE_linear\n",
    "RMSE_quad\n",
    "MAE_linear\n",
    "MAE_quad\n"
   ]
  },
