    "Здесь были построены обычная линейная модель и нелинейная модель с фейлами^2. Anova показало, что нелинейность статистически модель не меняет p-value = 0.059. Метрики тоже почти не изменились. В линейной модели количество провалов оказалось статистически значимым, влияет оно отрицательно (коэффициент ≈ −2.20, p-value < 0.05). Влияние переменной studytime так и осталось статистически незначимым."
